import React from 'react';
import { withRouter } from 'react-router-dom';
import './appointment.scss';
import { Input, Table, Tag, Space } from 'antd';
const columns = [
  {
    title: 'AppointmentID',
    dataIndex: 'id',
    key: 'id',
    render: text => <p>{text}</p>,
  },
  {
    title: 'PatientName',
    dataIndex: 'age',
    key: 'age',
  },
  {
    title: 'DoctorName',
    dataIndex: 'address',
    key: 'address',
  },
  {
    title: 'Type',
    key: 'type',
    dataIndex: 'type'
  },
  {
    title: 'Date',
    key: 'date',
    dataIndex: 'date'
  },
  {
    title: 'Status',
    key: 'status',
    dataIndex: 'status'
  },
];

const data = [
  {
    key: '1',
    id: '0001',
    age: 32,
    address: 'New York No. 1 Lake Park',
    tags: ['nice', 'developer'],
  },
  {
    key: '2',
    id: '0002',
    age: 42,
    address: 'London No. 1 Lake Park',
    tags: ['loser'],
  },
];

class Appointment extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      data: []
    };
  }
  componentDidMount(){
    React.$api.post('/patient/checkApp?patientId=100',{
      // patientId: 100
    }).then(data => {
      console.log(data);
      this.setState({
        data: data
      })
    })
  }
  render() {
    return (
      <div className="appointment">
        <div className="appointment-header">
          <p>Appointment</p>
          <Input size="large" placeholder="Search"/>
        </div>
        <Table columns={columns} dataSource={data} />
        {/* Appointment */}
      </div>
    );
  }
}

export default withRouter(Appointment);
